    return(
        <div>
            <form onSubmit={(e) => {
                this.add(e)
                this.goHome()
                }}>
                <input type='text' placeholder='Painting Title'/>
                <input type='text' placeholder='Painting Image URL'/>
                <input type='text' placeholder='Artist Name'/>
                <input type='submit' value='Add Painting'/>
            </form>
            <Link to="/dashboard">
                HOME
            </Link>
        </div>
    )}
}

